import React from 'react';
import HeroSection from '../../components/HeroSection';
import PageLayout from '../../components/PageLayout';
import InfoCard from '../../components/InfoCard';

const PinealGland = () => {
  return (
    <PageLayout>
      <HeroSection title="The Pineal Gland" />
      <InfoCard
        title="Awakening Your Pineal Gland"
        content="The pineal gland, also known as the third eye, is believed to be a center of intuition and spiritual insight..."
      />
    </PageLayout>
  );
};

export default PinealGland;
